import React from 'react';

const Features = ({ data }) => {
  return (
    <section className="features">
      {data.map((feature, index) => (
        <div key={index} className="feature">
          <img src={feature.icon} alt={feature.title} />
          <img src={feature.icon} alt={feature.title} />
          <h3>{feature.title}</h3>
          <p>{feature.description}</p>
        </div>
      ))}
    </section>
  );
};

export default Features;
